    nameOfSkill: String,
}

interface MySkill {
    skill: Skill[]
}

const MySkills = ({skill}: MySkill) => {

  const [value, setValue] = useState('')
  const handleChange = (value: any) => {
    setValue(value)
  }
  console.log(value)

  return (
    <section id='mySkills' className= {styles.main_mySkills}>
